pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/math/Math.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TriganDaoERC20Token is ERC20, Ownable {
    using SafeMath for uint256;

    uint8 internal _decimals = 20; // TKNBits multiplies of 100,
    uint8 internal _taxAgainstUsPercentage = 6; // divided equally between Project|Liquidity|Marketing
    uint8 internal _taxAgainstOthersPercentage = 18; // divided equally between Project|Liquidity|Marketing
    uint256 internal _maxTransferFee = 100 * uint256(10) ** 18; // 100 tokens 
    address internal _taxReceiver;
    address internal _saleAddress;
    address[] internal _dutiesFree;

    constructor(uint256 initialSupply, address taxReceiver) public ERC20("TriganDAOE20", "TDE") {
        _mint(msg.sender, initialSupply);
        _taxReceiver = taxReceiver;
        _dutiesFree.push(owner());
    }

    /**
     * @dev See {IERC20-approve}.
     *
     * Requirements:
     *
     * - `spender` cannot be the zero address.
     */
    function approve(address spender, uint256 amount) public override returns (bool) {
        return super.approve(spender, amount);
    }

    /**
     * @dev Moves tokens `amount` from `sender` to `recipient`.
     *
     * This is internal function is equivalent to {transfer}, and can be used to
     * e.g. implement automatic token fees, slashing mechanisms, etc.
     *
     * Emits a {Transfer} event.
     *
     * Requirements:
     *
     * - `sender` cannot be the zero address.
     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     */
    function _transfer(address sender, address recipient, uint256 amount) internal override {
        require(amount % (uint256(10) ** _decimals) == 0, "tokens to buy must be multiples of 100");

        if(taxIgnored(sender)) {
            return super._transfer(sender, recipient, amount);
        }

        uint256 taxAmount = _taxCalculator(sender, amount);

        super._transfer(sender, _taxReceiver, taxAmount);
        super._transfer(sender, recipient, amount.sub(taxAmount));
    }

    /**
     * @dev calculate tax
     * @param tokenAmount Number of tokens to be purchased
     */
    function _taxCalculator(address sender, uint256 tokenAmount) internal view returns (uint256) {
        // add tax conditions here 
        // if seller is from TriganDaoERC20ForSale address then take 6% of sale
        uint8 transferFeePercentage = _taxAgainstUsPercentage; 
        
        if (sender != _saleAddress) {
            transferFeePercentage = _taxAgainstOthersPercentage;
        }

        return Math.min(tokenAmount.mul(transferFeePercentage).div(100), _maxTransferFee);
    }

    function setSaleAddress(address addr) public {
        _saleAddress = addr;
    }

    function taxIgnored(address addr) internal view returns (bool) {
        for(uint256 i; i < _dutiesFree.length; i++) {
            if(_dutiesFree[i] == addr) {
                return true;
            }
        }

        return false;
    }
}

